import React from "react";
import { Link } from "react-router-dom";
import homeicon from "../images/homeicon.png";
import searchicon from "../images/searchicon.png";
import foldericon from "../images/foldericon.png";
import mailicon from "../images/mailicon.png";
import capicon from "../images/capicon.png";
import "./styles/Navbar.css";

function Navbar(props) {
    var two = props.second;
    var three = props.third;
    var four = props.fourth;
    return(
        <div className="Navbar">
            <Link to="/">
                <img className="button" src={homeicon}/>
            </Link>

            <Link to="/Portfolio">
                <img className="button" src={foldericon}/>
            </Link>

            <Link to="/Contact">
                <img className="button" src={mailicon}/>
            </Link>

            <Link to="/Experience">
                <img className="button" src={capicon}/>
            </Link>
        </div>
    );
}

export default Navbar;
